INSERT INTO `INGREDIENTS` VALUES ('1', '1', '2 cups rice-preferably parboiled', '2018-04-24 08:26:08'), ('2', '1', '1/2 cup split and husked Black Gram (Dhuli Urad)', '2018-04-24 08:26:20'), ('3', '1', '1/2 tsp fenugreek seeds', '2018-04-24 08:26:29'), ('4', '1', '2 tsp salt', '2018-04-24 08:26:37'), ('5', '1', 'Oil to smear the pan for cooking the dosas', '2018-04-24 08:26:56');
