-- ----------------------------
--  Records of `METHODS`
-- ----------------------------
BEGIN;
INSERT INTO `METHODS` VALUES ('1', '1', 'Wash and soak the rice in one container and the dal and fenugreek seeds together in another container for 5-6 hours or over night, depending on the weather.', '1', '2018-04-24 08:22:01'), ('2', '1', 'Grind dal mixture together to a very smooth consistency. Next grind the rice smooth too and mix the two batters.', '2', '2018-04-24 08:22:14'), ('3', '1', 'Add salt and enough water to make into a dropping consistency. Leave to ferment over-night or more depending on the weather, till a little spongy.', '3', '2018-04-24 08:22:34'), ('4', '1', 'If thickened too much, add a little water to thin a bit. Heat tawa, and brush oil over it. When really hot, splash a little water over it, and immediately pour batter onto it, spreading it thin, with a circular motion.', '4', '2018-04-24 08:22:50'), ('5', '1', 'This will have to be very swift and will need a bit of practice.', '5', '2018-04-24 08:23:01'), ('6', '1', 'After spreading the batter, lower the heat and dribble a little oil around the edges so that it seeps under the dosa.', '6', '2018-04-24 08:23:11'), ('7', '1', 'When edges start browning a bit, pass a flat spoon under it to ease the dosa off the pan. Put desired filling in the center, and fold the two edges over.', '7', '2018-04-24 08:23:22'), ('8', '1', 'Serve accompanied with sambhar and chutney.', '8', '2018-04-24 08:23:36');
COMMIT;

