-- ----------------------------
--  Records of `RECIPES`
-- ----------------------------
BEGIN;
INSERT INTO `RECIPES` VALUES ('1', 'Dosa', 'data:image/jpeg;base64,', 'https://youtu.be/aV_M3EvgOJY', 'A properly made crisp and savory Indian dosa is wonderfully delicious, and fairly simple to make at home, with this caveat: the batter must be fermented overnight for the correct texture and requisite sour flavor. However, once the batter is ready, it can be refrigerated and kept for several days, even a week. With a traditional spicy potato filling, dosas makes a perfect vegetarian breakfast or lunch. Serve them with your favorite chutney.', 'a', null, '1', '2018-03-06 11:08:34', '2018-04-24 23:38:24');
INSERT INTO `RECIPES` VALUES ('3', 'Fish Tacos', 'data:image/jpeg;base64,', null, 'Fish tacos, that great meal of the Baja Peninsula, and a taste of summer. They are simple to make, no more complicated in fact than a hamburger or a mess of pancakes, and they are considerably more flavorful. Fried in strips and served onboard warm corn tortillas with a simple salsa, a pinch of fresh cabbage, plenty of lime and a cream sauce you might want to punch up with some chopped chipotle, these fish tacos can turn a cold night into bluebird summer, transporting you from chill into deep humidity and bliss.', null, null, '1', '2018-03-04 17:03:14', '2018-03-06 19:47:06');
INSERT INTO `RECIPES` VALUES ('4', 'Alfredo', 'data:image/jpeg;base64,', 'https://www.youtube.com/embed/EQxCtNIkZ8U', 'This recipe came to The Times in a 2004 article about Elaine Kaufman, the founder and proprietress of the famed New York restaurant and celebrity hot spot that bore her name and where this dish was served. There is nothing fancy or complicated about it  it\'s glorified macaroni and cheese, really  but it is delicious and deeply satisfying. (Fun fact: Jackie O was a fan.)', '12 cup butter\n2 tablespoons cream cheese\n1 pint heavy cream\n1 teaspoon garlic powder\nsalt\nblack pepper\n23 cup grated parmesan cheese (preferably fresh)\n1 lb fettuccine, prepared as directed', 'In a medium saucepan, melt butter.\nWhen butter is melted, add cream cheese.\nWhen the cream cheese is softened, add heavy cream.\nSeason with garlic powder, salt, and pepper.\nSimmer for 15-20 minutes over low heat, stirring constantly.\nRemove from heat and stir in parmesan.\nServe over hot fettucine noodles.', '1', '2018-02-18 17:05:59', '2018-03-06 21:34:02');
INSERT INTO `RECIPES` VALUES ('5', 'Spaghetti With Fried Eggs', 'data:image/jpeg;base64,', null, 'Here\'s a quick and delicious pasta dish to make when you have little time, and even less food in the house. All you need is a box of spaghetti, four eggs, olive oil and garlic (Parmesan is a delicious, but optional, addition).', null, null, '1', '2018-02-18 17:07:18', '2018-02-18 17:07:18');
INSERT INTO `RECIPES` VALUES ('6', 'Naan (Indian Flatbread)', 'data:image/jpeg;base64,', null, 'In spite of its ancient origins and utter simplicity, the tandoor produces startlingly sophisticated results, including smoky flatbreads that puff like pillows, and roasted meats of uncommon succulence. But you can make naan just as easily in an oven.', null, null, '1', '2018-02-18 17:10:08', '2018-02-18 17:10:08');
COMMIT;

